  `icp_info` varchar(100) DEFAULT NULL COMMENT 'icp信息',
  `logo` varchar(255) DEFAULT NULL COMMENT 'logo',
  `shop_name` varchar(30) DEFAULT NULL COMMENT '商家名字',
  `url` varchar(255) DEFAULT NULL,
  `support_mail` varchar(255) DEFAULT NULL COMMENT '多个邮箱，用逗号隔开',
  `internationalCode` varchar(5) DEFAULT NULL,
  `areaCode` varchar(10) DEFAULT NULL,
  `telephone` varchar(20) DEFAULT NULL,
  `wechat_title_pic` varchar(512) DEFAULT NULL,
  `wechatCode` varchar(512) DEFAULT NULL COMMENT '微信的服务号',
  `reg_protocol_template` text COMMENT '注册协议模板',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统配置表';

