/*Table structure for table `bs_delivery` */

CREATE TABLE `bs_delivery` (
  `dvy_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT 'ID',
  `name` varchar(50) NOT NULL DEFAULT '' COMMENT '物流公司名称',
  `company_code` varchar(200) NOT NULL COMMENT '物流公司编号根据快递100查询',
  `create_time` datetime NOT NULL COMMENT '建立时间',
  PRIMARY KEY (`dvy_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='物流公司';

/*Data for the table `bs_delivery` */

/*Table structure for table `bs_pay_type` */

CREATE TABLE `bs_pay_type` (
  `pay_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT 'ID',
  `pay_type_id` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '付款方式ID ALP,WX_PAY等等',
  `pay_type_name` varchar(50) DEFAULT NULL COMMENT '付款方式',
  `is_enable` int(1) NOT NULL DEFAULT '0' COMMENT '是否启用',
  `payment_config` text COMMENT '支付接口配置信息',
  PRIMARY KEY (`pay_id`,`is_enable`),
  UNIQUE KEY `uni_pt_username_type_id` (`pay_type_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='付款方式';

/*Data for the table `bs_pay_type` */

/*Table structure for table `bs_provinces` */

CREATE TABLE `bs_provinces` (
  `id` int(11) NOT NULL DEFAULT '0' COMMENT 'ID',
  `provinceid` varchar(20) NOT NULL DEFAULT '0' COMMENT '邮编',
  `province` varchar(50) NOT NULL DEFAULT '' COMMENT '省份名称',
  `groupby` varchar(10) NOT NULL DEFAULT '',
  `short_name` varchar(50) NOT NULL DEFAULT '' COMMENT '省份简称',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uni_provinceid` (`provinceid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='省份表';

