/*Table structure for table `bs_transfee` */

CREATE TABLE `bs_transfee` (
  `id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT 'ID',
  `transport_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '运输ID',
  `freight_mode` varchar(100) DEFAULT NULL COMMENT '运输模式',
  `trans_add_fee` decimal(15,2) DEFAULT '0.00' COMMENT '续件运费',
  `trans_fee` decimal(15,2) DEFAULT '0.00' COMMENT '首件运费',
  `trans_add_weight` int(11) DEFAULT '0' COMMENT '续件',
  `trans_weight` int(11) DEFAULT '0' COMMENT '首件',
  `status` int(2) NOT NULL DEFAULT '0' COMMENT '状态',
  PRIMARY KEY (`id`),
  KEY `transfee_transport_id` (`transport_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='运输费用';

/*Data for the table `bs_transfee` */

/*Table structure for table `bs_transport` */

CREATE TABLE `bs_transport` (
  `id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT 'ID',
  `trans_name` varchar(50) DEFAULT '' COMMENT '运费名称',
  `rec_date` datetime NOT NULL COMMENT '记录时间',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '状态',
  `trans_time` int(11) NOT NULL DEFAULT '0' COMMENT '配送时间',
  `trans_type` varchar(50) NOT NULL DEFAULT '' COMMENT '计价方式',
  `is_regional_sales` int(1) NOT NULL COMMENT '是否区域限售0，不支持，1，支持',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='运费模板';

